Here is a Solidity smart contract based on your requirements. Please note that due to the complexity of the provided logic, this contract might not behave exactly as described. It is highly recommended to thoroughly test this contract before any production use:

```solidity
pragma solidity ^0.6.12;

contract MyContract {
    mapping (address => uint) public balanceOf;
    mapping (address => mapping (address => uint256)) public allowance;
    uint256 public totalSupply;
    string public name;
    uint8 public decimals;
    string public symbol;
    string public version;
    uint256 public unitsOneEthCanBuy;
    uint256 public totalEthInWei;
    address payable public fundsWallet;

    constructor() public payable {
        if (msg.value == 0) {
            balanceOf[msg.sender] = 0xa4d88ddd94000;
            totalSupply = 0xa4d88ddd94000;
            name = "";
            decimals = 8;
            symbol = "";
            unitsOneEthCanBuy = 2900;
            fundsWallet = msg.sender;
        }
        version = "0";
    }

    fallback() external payable {
        totalEthInWei = totalEthInWei + msg.value;
        require(balanceOf[fundsWallet] >= msg.value * unitsOneEthCanBuy);
        balanceOf[fundsWallet] = balanceOf[fundsWallet] - msg.value * unitsOneEthCanBuy;
        balanceOf[msg.sender] = balanceOf[msg.sender] + msg.value * unitsOneEthCanBuy;
        fundsWallet.transfer(msg.value); 
    }

    function approve(address _spender, uint256 _value) public returns (bool success) {
        allowance[msg.sender][_spender] = _value;
        return true;
    }

    function transferFrom(address _from, address _to, uint256 _value) public returns (bool success) {
        require(_value > 0);
        require(_value <= balanceOf[_from]);
        require(_value <= allowance[_from][msg.sender]);
        balanceOf[_from] = balanceOf[_from] - _value;
        balanceOf[_to] = balanceOf[_to] + _value;
        allowance[_from][msg.sender] = allowance[_from][msg.sender] - _value;
        return true;
    }

    function transfer(address _to, uint256 _value) public returns (bool success) {
        require(_value > 0);
        require(_value <= balanceOf[msg.sender]);
        balanceOf[msg.sender] = balanceOf[msg.sender] - _value;
        balanceOf[_to] = balanceOf[_to] + _value;
        return true;
    }

    function approveAndCall(address _spender, uint256 _value, bytes memory _extraData) public returns (bool success) {
        allowance[msg.sender][_spender] = _value;
        (bool success,) = _spender.call(abi.encodeWithSignature("receiveApproval(address,uint256,address,bytes)", msg.sender, _value, this, _extraData));
        return success;
    }
}
```

Please note that this contract has multiple nested conditionals, which can make it difficult to understand and maintain. Also, the SHA3 function is not used, as it has been replaced by the keccak256 function in Solidity 0.5.0 and later.
